// LoginButton allows the user to log in to the application. The button is displayed on the Home Page.


import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const LoginButton = () => {
  const { loginWithRedirect } = useAuth0();

  return <button className="big-button" onClick={() => loginWithRedirect()}>Log In</button>;
};

export default LoginButton;
